--
-- Triggers `ozekimessagein`
--
DELIMITER $$
CREATE TRIGGER `before_insert_ozekimessagein` BEFORE INSERT ON `ozekimessagein` FOR EACH ROW BEGIN
    -- Declare all variables at the beginning (MariaDB requirement)
    DECLARE msg_valid BOOLEAN DEFAULT FALSE;
    DECLARE out_msg VARCHAR(255) DEFAULT '';
    DECLARE valid_votes VARCHAR(255) DEFAULT '';
    DECLARE vote_part VARCHAR(255);
    DECLARE position VARCHAR(3);
    DECLARE voted_positions VARCHAR(255) DEFAULT '';
    DECLARE reference_number VARCHAR(20);
    DECLARE existing_reference VARCHAR(20);
    DECLARE current_datetime DATETIME;
    DECLARE current_time_var TIME;
    DECLARE voter_exists INT DEFAULT 0;
    DECLARE voter_id_value INT DEFAULT NULL;
    DECLARE candidate_exists INT DEFAULT 0;

    -- Check if sender exists in voter table
    SELECT COUNT(*), voterID INTO voter_exists, voter_id_value
    FROM voter
    WHERE contactNumber = NEW.sender
    LIMIT 1;

    IF voter_exists = 0 THEN
        SET NEW.remarks = 'INVALID';
        SET out_msg = 'You are not registered as a voter.';
        
        INSERT INTO ozekimessageout(sender, receiver, msg, _status)
        VALUES (NEW.receiver, NEW.sender, out_msg, 'send');
    ELSE
        -- Set voterID in the record
        SET NEW.voterID = voter_id_value;

        -- Get current datetime in Philippine Time
        SET current_datetime = CONVERT_TZ(NOW(), 'SYSTEM', 'Asia/Manila');
        SET current_time_var = TIME(current_datetime);

        -- Check voting time (before 3:00 PM)
        IF current_time_var > '15:00:00' THEN
            SET NEW.remarks = 'INVALID';
            SET out_msg = 'Voting has ended.';
        ELSE
            -- Check for existing valid vote
            SELECT reference INTO existing_reference
            FROM ozekimessagein
            WHERE sender = NEW.sender AND remarks = 'VALID'
            LIMIT 1;

            IF existing_reference IS NOT NULL THEN
                SET NEW.remarks = 'INVALID';
                SET out_msg = CONCAT('You have already voted with reference number ', existing_reference, '.');
            ELSE
                -- Generate reference number
                SET reference_number = CONCAT(
                    SUBSTRING(MD5(RAND()), 1, 8),
                    '-', 
                    FLOOR(1000 + RAND() * 9000)
                );

                -- Process vote message
                IF NEW._status IS NULL THEN
                    IF LEFT(NEW.msg, 5) = 'vote ' OR LEFT(NEW.msg, 6) = 'VOTED ' THEN
                        SET @message_part = SUBSTRING(NEW.msg, 
                            CASE 
                                WHEN LEFT(NEW.msg, 5) = 'vote ' THEN 6 
                                ELSE 7 
                            END
                        );

                        -- Parse vote parts
                        WHILE LOCATE(',', @message_part) > 0 DO
                            SET vote_part = TRIM(SUBSTRING_INDEX(@message_part, ',', 1));
                            SET @message_part = SUBSTRING(@message_part, LOCATE(',', @message_part) + 1);

                            -- Check if vote_part exists in candidate table
                            SELECT COUNT(*) INTO candidate_exists
                            FROM candidate
                            WHERE codeName = vote_part;

                            IF candidate_exists > 0 THEN
                                -- Extract position prefix (p, v, s, t, a, b, or pro)
                                IF LEFT(vote_part, 3) = 'pro' THEN
                                    SET position = 'pro';
                                ELSE
                                    SET position = LEFT(vote_part, 1);
                                END IF;

                                IF FIND_IN_SET(position, voted_positions) THEN
                                    -- Remove previous votes for this position
                                    SET valid_votes = REGEXP_REPLACE(valid_votes, CONCAT(position, '[^,]*,'), '');
                                ELSE
                                    SET valid_votes = CONCAT(valid_votes, vote_part, ', ');
                                    SET voted_positions = CONCAT(voted_positions, position, ',');
                                END IF;
                            END IF;
                        END WHILE;

                        -- Check last vote part
                        SET vote_part = TRIM(@message_part);
                        -- Check if vote_part exists in candidate table
                        SELECT COUNT(*) INTO candidate_exists
                        FROM candidate
                        WHERE codeName = vote_part;

                        IF candidate_exists > 0 THEN
                            -- Extract position prefix (p, v, s, t, a, b, or pro)
                            IF LEFT(vote_part, 3) = 'pro' THEN
                                SET position = 'pro';
                            ELSE
                                SET position = LEFT(vote_part, 1);
                            END IF;

                            IF FIND_IN_SET(position, voted_positions) THEN
                                -- Remove previous votes for this position
                                SET valid_votes = REGEXP_REPLACE(valid_votes, CONCAT(position, '[^,]*,'), '');
                            ELSE
                                SET valid_votes = CONCAT(valid_votes, vote_part, ', ');
                                SET voted_positions = CONCAT(voted_positions, position, ',');
                            END IF;
                        END IF;

                        -- Final validation
                        IF valid_votes <> '' THEN
                            SET valid_votes = LEFT(valid_votes, LENGTH(valid_votes) - 2); -- Remove trailing comma and space
                            SET msg_valid = TRUE;
                        END IF;
                    END IF;

                    -- Set final status and message
                    IF msg_valid THEN
                        SET NEW.remarks = 'VALID';
                        SET NEW.reference = reference_number;
                        SET out_msg = CONCAT('You have voted for ', valid_votes, '. Your reference number is ', reference_number, '. Thank you for voting!');
                    ELSE
                        SET NEW.remarks = 'INVALID';
                        SET out_msg = 'Invalid vote. Please check your candidates and try again!';
                    END IF;
                END IF;
            END IF;
        END IF;
        
        -- Send response
        INSERT INTO ozekimessageout(sender, receiver, msg, _status)
        VALUES (NEW.receiver, NEW.sender, out_msg, 'send');
    END IF;
END
$$
DELIMITER ;

